function uploadattachment(repid) {
  var repname = Erp.Repeater.GetItemCount(repid);
  var fileExtension = null;
  var fileSize=25;
  if(repid=="rpt_uploadcertificate" || repid=="rpt_personaldetail" || repid=="rpt_hiringform" || repid=="rpt_bgverification" || repid=="rpt_EsiDeclaration" || repid=="rpt_pfform" || repid=="rpt_resume" || repid=="rpt_others" || repid=="rpt_passport"|| repid=="rpt_pan" || repid=="rpt_voterid" || repid=="rpt_drivinglicence" || repid=="rpt_aadhar" || repid=="rpt_payslip" || repid=="rpt_relievingletter" || repid == 'rpt_canclecheck') {
    fileExtension = "jpg,jpeg,png,bmp,pdf,xlsx,xls,docx,doc,rtf,pptx,zip,rar,bak,pib,mdf,ldf,sbr,db,xml";
  }
  else if(repid=="rpt_selfimagge"){
    fileExtension = "jpg,jpeg,png";
    fileSize=1;
  }
  Erp.ShowFileUpload({
    fileExt: fileExtension, fileSize:fileSize,parent:"", showLink: true,linkUrl:"../temp/test.gif", title: "Upload File", 
    onUploadComplete: function(r,o){
      var dtype = Fn.Replace(repid,'rpt_','') ;
      Erp.Repeater.AddItem(repid, null, {
        attachment:r.tempUrl,attachment_preview:r.fileName,ext:r.fileName,doctype:Fn.Trim(dtype)}
                          )
      $("#"+repid+"-ctr").find(".note-add").hide();
      Erp.ShowMessage('Your document uploaded successfully','success')
    }
    , onUploadCancel:  function(options){
    }
  }
                    );
}
