function isImg(img){
  if(!Fn.IsEmpty(img))
  {
    var ext=Fn.ToLowerCase(img.split('.')[img.split('.').length-1])
    return ",gif,jpg,jpe*,png,bmp,dib,tif,wmf,ras,eps,pcx,pcd,tga,".indexOf("," + ext + ",")>-1 || ext.indexOf("jpe")>-1
  }
}
